#nullable enable
namespace DealCardGame.Resources;
public static class SvgPngImageResource
{
    private readonly static string _hotel = "data:image/svg+xml;base64,";
    public static string Hotel => "hotel.svg";
    private readonly static string _house = "data:image/svg+xml;base64,";
    public static string House => "house.svg";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("hotel.svg", _hotel);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("house.svg", _house);
    }
}